import React from "react";

const BillPage = props => {
  console.log(props.location.state);
  return (
    <div className="row">
      <div className="col s12 m7 l7" style={{ backgroundColor: "grey" }}>
        <div>
          {props.location.state.all.map((i, index) => {
            return (
              <div key={index}>
                {i} => {props.location.state.item[i].req} Rs.
                {props.location.state.item[i].totPrice}
              </div>
            );
          })}
          Total {props.location.state.bill}
        </div>
      </div>
      <div className="col s12 m4 l4">
        products Price:
        <input type="number" disabled value={props.location.state.bill} />
      </div>
    </div>
  );
};

export default BillPage;
